CREATE SCHEMA `country` ;
use country;


drop table if exists country;
drop table if exists capital;
drop table if exists city;
drop table if exists countrylanguage;


CREATE TABLE `country` (
  `Code` varchar(45) NOT NULL,
  `Name` varchar(145) DEFAULT NULL,
  `Continent` varchar(145) DEFAULT NULL,
  `Region` varchar(145) DEFAULT NULL,
  `Area` float DEFAULT NULL,
  `IndepYear` int(11) DEFAULT NULL,
  `Population` bigint(20) DEFAULT NULL,
  `LifeExpectancy` float DEFAULT NULL,
  PRIMARY KEY (`Code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;



CREATE TABLE `country`.`capital` (
  `ID` INT NOT NULL,
  `CountryCode` VARCHAR(45) NULL,
  `Name` VARCHAR(45) NULL,
  PRIMARY KEY (`ID`));


CREATE TABLE `country`.`city` (
  `ID` INT NOT NULL,
  `Name` VARCHAR(45) NULL,
  `CountryCode` VARCHAR(45) NULL,
  `District` VARCHAR(45) NULL,
  `Population` DOUBLE NULL,
  PRIMARY KEY (`ID`));


CREATE TABLE `countrylanguage` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `CountryCode` varchar(45) DEFAULT NULL,
  `Language` varchar(145) DEFAULT NULL,
  `IsOfficial` char(1) DEFAULT NULL,
  `Percentage` float DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=985 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
SELECT * FROM country.countrylanguage;




















